import * as React from 'react';
import {ApplicationState} from "../../../store";
import SquadronModel from "../../../store/squadrons/SquadronModel";
import styled from "../../../utils/styled";
import {connect} from "react-redux";
import {squadronPostRequest, updateSquadronInputState} from "../../../store/squadrons/actions";

interface PropsFromState {
    posting: boolean;
    squadrons: SquadronModel[];
    newInput: SquadronModel;
    squadronsErrors?: string;
}

interface PropsFromDispatch {
    PostRequest: typeof squadronPostRequest;
    updateInputState: typeof updateSquadronInputState;
}

// Combine both state + dispatch props - as well as any props we want to pass - in a union type.
type AllProps = PropsFromState & PropsFromDispatch;

class AddSquadronBar extends React.Component<AllProps> {

    public render() {
        return (
            <Wrapper>
                <input
                placeholder={"Name"}>
                </input>
            </Wrapper>
        );
    }
}

const mapStateToProps = ({squadrons}: ApplicationState) => ({
    posting: squadrons.posting,
    squadrons: squadrons.squadrons,
    SqInput: squadrons.newInput,
    Errors: squadrons.errors,
});


const mapDispatchToProps = {
    squadronPostRequest,
    updateSquadronInputState
};

export default connect(
    mapStateToProps,
    mapDispatchToProps,
)(AddSquadronBar);

    const Wrapper = styled('div')`
  display: block;
  width: 100%;
  font-family: ${props => props.theme.fonts.headings};
  font-size: large;
  margin-bottom: 1px;

  .input {
  width: 100%;
  height: 16px;
  background: white;
  }

`;
